import React, { useState } from 'react';

const Synchtwo = ()=>{
    
    const [c1,setC1] = useState();
    const [x1,setX1]= useState();
    const [c2,setC2] = useState();
    const [x2,setX2]= useState();
   const chng1=(event)=>{
       setC1(event.target.value);
   }
   const chng2=(event)=>{
       setC2(event.target.value);
   }
   const evaluate=()=>{
       setX1(c1);
       setX2(c2);
      var arr1 = c1.split(',').map(function(c1){return Number(c1);});
      var arr2 = c2.split(',').map(function(c2){return Number(c2);});
   };
   return(
       <>
           <h1>Synchronous 2-bit</h1>
          
             <input type="text" classNameName="inp" id="dff1" placeholder="1,2,3.." onChange={chng1} value={c1}/> 
             <input type="text" classNameName="inp" id="dff2" placeholder="1,2,3.." onChange={chng2} value={c2}/> 
             <button type="submit" classNameName="clickme" onClick={evaluate} >Go ðŸ™‚</button>
             <table className="tg">
<thead>
  <tr>
    <th className="tg-0pky" colSpan="2">Present State</th>
    <th className="tg-0pky" colSpan="2">Flip-Flop Inputs</th>
    <th className="tg-0pky" colSpan="2">Next State</th>
  </tr>
</thead>
<tbody>
  <tr>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
  </tr>
  <tr>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
  </tr>
  <tr>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
  </tr>
  <tr>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
  </tr>
  <tr>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
    <td className="tg-0pky"></td>
  </tr>
</tbody>
</table>
       </>
   );
};
export default Synchtwo;
